	public static function convert(array $in)
	{
		/* Determine initial string length */
		$in_length = count($in);
		$out = [];

		/* Loop over input array */
		for ($i = 0; $i < $in_length; $i++) {
			$block = $in[$i] >> 8;
			$cp    = $in[$i] & 255;

			$no_jump = 0;
			switch ($block) {
				case 0: $jump_map = self::$jump_table[0]; $replace_map = self::$map_table[0]; break;
				case 32: $jump_map = self::$jump_table[1]; $replace_map = self::$map_table[1]; $transpose_map = self::$transpose_table[0]; break;
				case 6: $jump_map = self::$jump_table[2]; $transpose_map = self::$transpose_table[1]; break;
				case 9: $jump_map = self::$jump_table[3]; $transpose_map = self::$transpose_table[2]; break;
				case 10: $jump_map = self::$jump_table[4]; $transpose_map = self::$transpose_table[3]; break;
				case 11: $jump_map = self::$jump_table[5]; $transpose_map = self::$transpose_table[4]; break;
				case 12: $jump_map = self::$jump_table[6]; $transpose_map = self::$transpose_table[5]; break;
				case 13: $jump_map = self::$jump_table[7]; $transpose_map = self::$transpose_table[6]; break;
				case 14: $jump_map = self::$jump_table[8]; $transpose_map = self::$transpose_table[7]; break;
				case 15: $jump_map = self::$jump_table[9]; $transpose_map = self::$transpose_table[8]; break;
				case 16: $jump_map = self::$jump_table[10]; $transpose_map = self::$transpose_table[9]; break;
				case 19: $jump_map = self::$jump_table[11]; $transpose_map = self::$transpose_table[10]; break;
				case 23: $jump_map = self::$jump_table[12]; $transpose_map = self::$transpose_table[11]; break;
				case 24: $jump_map = self::$jump_table[13]; $transpose_map = self::$transpose_table[12]; break;
				case 25: $jump_map = self::$jump_table[14]; $transpose_map = self::$transpose_table[13]; break;
				case 50: $jump_map = self::$jump_table[15]; $transpose_map = self::$transpose_table[14]; break;
				case 255: $jump_map = self::$jump_table[16]; $transpose_map = self::$transpose_table[15]; break;
				default: $no_jump = 1;
			}
			if ($no_jump) {
				$jump = 0;
			} else {
				$jump = $jump_map[$cp];
			}

			switch ($jump) {
				case 0: /* No changes */
					$out[] = $in[$i];
					break;
				case 1: /* Simple mapping */
					$out[] = $replace_map[$cp];
					break;
				case 4: /* Transpose Up */
					$out[] = $in[$i] + $transpose_map[$cp];
					break;
				case 5: /* Transpose Down */
					$out[] = $in[$i] - $transpose_map[$cp];
					break;
			}
		}
		return $out;
	}
